('C',	'24',	'241',	NULL,	'24101',	'Pengeluaran jongkong besi dan spiegeleisen dalam\nbentuk jongkong, blok atau dalam bentuk asal lain(2)',	'27100p',	'(2) Termasuk: (a) pengeluaran ferro-aloi\n(b) pengeluaran produk bagi besi atau keluli bukan aloi separa siap\n(c) pengeluaran jongkong, keluli tahan karat atau aloi keluli lain dalam bentuk asal\nlain dan produk separa siap'),
('C',	'24',	'241',	NULL,	'24102',	'Pembuatan batang dan rod keluli tahan karat atau keluli\naloi lain(3)',	'27100p',	'(3) Termasuk: (a) pengeluaran keluli tahan karat atau keluli aloi lain dalam bentuk penjuru,\nberbentuk dan bahagian\n(b) pengeluaran batang dan rod besi atau keluli bukan aloi\n(c) pengeluaran produk flat-rolled daripada besi atau keluli bukan aloi\n(d) pengeluaran besi atau keluli bukan aloi dalam bentuk penjuru, berbentuk dan\nbahagian\n(e) pembuatan batang keluli atau keluli padu melalui proses tempaan sejuk,\npengisaran atau pembalikan'),
('C',	'24',	'241',	NULL,	'24103',	'Pembuatan tiub tidak berkelim, dengan penggelekan,\npicitan atau tempaan panas, atau dengan tempaan atau\npenggelekan sejuk(4)',	'27100p',	'(4) Termasuk: pembuatan tiub kimpalan melalui pembentukan panas atau sejuk dan kimpalan,\nmelalui pembentukan dan tempaan sejuk, atau melalui pembentukan panas dan\npenurunan'),
('C',	'24',	'241',	NULL,	'24104',	'Pembuatan kelengkapan tiub keluli(1)',	'27100p',	'(1) Termasuk: pembuatan bahagian terbuka dengan proses pembentukan sejuk secara progresif\nmenggunakan mesin penggulung atau melipat ke atas produk keluli yang telah\ndigulung ratakan (flat-rolled)'),
('C',	'24',	'241',	NULL,	'24109',	'Pembuatan produk besi asas dan keluli lain t.t.t.l.(2)',	'27100p',	'(2) Termasuk: (a) operasi relau bagas, penukar keluli, mesin penggulung dan penyudah\n(b) pengeluaran kepingan cerucuk dari keluli dan keluli kimpalan bahagian\nterbuka\n(c) pengeluaran bahan keluli landasan kereta api (rel belum dipasang)\n(d) pembuatan dawai keluli oleh tempaan atau regangan sejuk\n(e) pengeluaran butir besi dan serbuk besi; pengeluaran besi tulen melalui\nelektrolisis atau proses kimia lain\n(f) peleburan semula sisa dan skrap ferus'),
