('C',	'24',	'242',	NULL,	'24202',	'Pengeluaran aluminium daripada alumina(2)',	'27209p',	'(2) Termasuk: pembuatan aluminium daripada penapisan elektrolitik sisa dan skrap aluminium,\npembuatan aluminium aloi, pembuatan-separa aluminium, pembuatan aluminium\noksida (alumina), pembuatan kerajang pembalut aluminium, pembuatan aluminium\n(timah) lamina kerajang di mana kerajang aluminium (timah) adalah komponen\nutama'),
('C',	'24',	'242',	NULL,	'24209',	'Pembuatan logam asas berharga dan logam bukan ferus\nlain t.t.t.l.(1)',	'27209p',	'(1) Termasuk: (a) pengeluaran logam asas berharga seperti emas, perak, platinum, dll.\n(b) pengeluaran logam aloi berharga\n(c) pengeluaran produk separa logam berharga\n(d) pengeluaran perak untuk disadur pada logam asas\n(e) pengeluaran emas untuk disadur pada logam asas atau perak\n(f) pengeluaran platinum dan logam kumpulan platinum untuk disadur pada\nemas, perak atau logam asas\n(g) pengeluaran plumbum, zink dan timah daripada bijih\n(h) pengeluaran plumbum, zink dan timah daripada penapisan elektrolitik\nplumbum, zink dan sisa dan skrap timah\n(i) pengeluaran plumbum, aloi zink dan timah\n(j) pembuatan separa plumbum, zink dan timah\n(k) pengeluaran tembaga daripada bijih\n(l) pengeluaran tembaga daripada penapisan elektrolitik sisa dan skrap tembaga\n(m) pengeluaran aloi tembaga\n(n) pembuatan dawai atau jalur fius\n(o) pembuatan separa tembaga\n(p) pengeluaran krom, mangan, nikel, dll. daripada bijih atau oksida\n(q) pengeluaran krom, mangan, nikel, dll. daripada elektrolitik dan penapisan\n”aluminothermic” sisa dan skrap bagi krom, mangan, nikel dll.\n(r) pengeluaran aloi krom, mangan, nikel, dll.\n(s) pembuatan separa krom, mangan, nikel, dll.\n(t) pengeluaran ”mattes” nikel\n(u) pengeluaran logam uranium daripada bijih mineral atau bijih lain\n(v) peleburan dan penapisan uranium\n(w) pembuatan dawai daripada logam tempaan\n(x) pembuatan kerajang berlamina logam berharga'),
