('C',	'25',	'251',	'2512(1)',	NULL,	'Pembuatan tangki, takungan dan kontena daripada\nlogam',	NULL,	'(1) Tidak termasuk: (a) pembuatan tong, dram, tin, baldi, kotak, dll. daripada logam yang biasanya\n digunakan untuk membawa dan membungkus barang (tidak mengira saiz),\nlihat 2599\n(b) pembuatan kontena pengangkut, lihat 2920\n(c) pembuatan tangki (kenderaan tentera berperisai), lihat 3040'),
('C',	'25',	'251',	NULL,	'25120',	'Pembuatan tangki, takungan dan kontena daripada\nlogam(2)',	'28120p',	'(2) Termasuk: (a) pembuatan takungan, tangki dan kontena seumpamanya daripada logam,\nbiasanya dipasang sebagai kelengkapan untuk storan atau kegunaan\npembuatan\n(b) pembuatan kontena daripada logam untuk gas mampat atau gas berbentuk\ncecair\n(c) pembuatan dandang pemanasan berpusat dan radiator'),
