('C',	'25',	'251',	NULL,	'25130',	'Pembuatan penjana wap, kecuali dandang pemanasan air\nberpusat(4)',	'28130p',	'(4) Termasuk: (a) pembuatan penjana wap atau penjana wap lain\n(b) pembuatan loji auksiliari untuk digunakan bersama penjana wap (cth.\nkondenser, economizers, superheaters, pengumpul wap dan akumulator)\n(c) pembuatan reaktor nuklear, kecuali pemisah isotop\n(d) pembuatan bahagian untuk dandang laut atau kuasa'),
