('C',	'25',	'252',	'2520(1)',	NULL,	'Pembuatan senjata dan peluru',	NULL,	'(1) Tidak termasuk:  (a) pembuatan kepala tukul (percussion caps), peledak, suar untuk memberi\nisyarat, dll., lihat 20299\n(b) pembuatan pedang pendek, pedang, bayonet, dll., lihat 2593\n(c) pembuatan kenderaan perisai untuk mengangkut wang atau barang berharga,\nlihat 29102\n(d) pembuatan kenderaan angkasa, lihat 3030\n(e) pembuatan kereta kebal dan kenderaan tempur lain, lihat 3040'),
('C',	'25',	'252',	NULL,	'25200',	'Pembuatan senjata dan peluru(2)',	'29270p',	'(2) Termasuk: (a) pembuatan senjata berat (meriam, senapang mudah alih, pelancar roket, tiub\ntorpedo, mesingan berat)\n(b) pembuatan senjata kecil (revolver, shotguns, mesingan ringan)\n(c) pembuatan senapang udara atau gas dan pistol\n(d) pembuatan peluru perang\n(e) pembuatan peluru berpandu tentera\n(f) pembuatan senjata api dan peluru untuk pemburuan, sukan atau perlindungan\n(g) pembuatan bahan letupan seperti bom, periuk api dan torpedo\n(h) pembuatan senjata dan peluru lain t.t.t.l.'),
