('C',	'25',	'259',	NULL,	'25910',	'Tempaan, tekanan, hentakan dan bentuk gelekan logam;\nserbuk metalurgi(2)',	'28910',	'(2) Termasuk: serbuk metalurgi : pengeluaran objek logam daripada serbuk logam secara terus\nmelalui rawatan haba (sintering) atau di bawah tekanan'),
('C',	'25',	'259',	'2592(3)',	NULL,	'Rawatan dan penyalutan logam; menggunakan mesin',	NULL,	'(3) Tidak termasuk: (a) aktiviti pemasangan ladam kuda, lihat 0162\n (b) gelekan logam berharga ke atas logam asas atau logam lain, lihat 2420'),
('C',	'25',	'259',	NULL,	'25920',	'Rawatan dan penyalutan logam; menggunakan mesin(4)',	'28920',	'(4) Termasuk: (a) penyaduran, penganodan, dll. daripada logam\n(b) rawatan haba bagi logam\n(c) menyah gerigis (deburring), pembagasan pasir (sandblasting), tumbling,\npembersihan logam\n(d) mewarna dan mengukir logam\n(e) salutan logam bukan metalik (cth. plasticizing, enamelling, lacquering, dll.)\n(f) mengeras, menggilap logam\n(g) menggerudi, memusing, mengisar, menghakis, mengetam, mempelas\n(melicinkan permukaan), menebuk, meratakan, menggergaji, mencanai,\nmengasah, menggilap, mengimpal, menyambat kepingan kerja logam\n(h) memotong dan menulis pada logam dengan cara laser'),
('C',	'25',	'259',	'2593(1)',	NULL,	'Pembuatan kutleri, alatan pertukangan tangan dan\nperkakasan am',	NULL,	'(1) Termasuk: (a) pembuatan katleri domestik seperti pisau, garfu, sudu, dll.\n(b) pembuatan pisau mata lebar dan parang, pisau pencukur dan mata pisau\ncukur, gunting dan pemotong rambut\n(c) pembuatan pisau dan mata pisau pemotong untuk mesin atau untuk\nperkakasan mekanikal\n(d) pembuatan alatan pertukangan tangan seperti playar, pemutar skru,dll.\n(e) pembuatan alatan pertukangan tangan pertanian tanpa kuasa\n(f) pembuatan gergaji dan mata gergaji, termasuk mata gergaji bulat dan mata\ngergaji berantai\n(g) pembuatan alat pertukangan tangan yang boleh ditukar, sama ada\nmenggunakan kuasa atau sebaliknya, atau untuk peralatan mesin (cth. gerudi,\npenebuk lubang, mata pengisar, dll.)\n(h) pembuatan alat tukang besi (cth. alat penempa, andas, dll.)\n(i) pembuatan ragum, pengapit\n(j) pembuatan ibu kunci, mangga, kunci, engsel dan seumpamanya, perkakasan\nuntuk bangunan, perabot, kenderaan, dll.\n(k) pembuatan pedang pendek, pedang, bayonet, dll.\n(l) pembuatan kotak pengacuan dan acuan (kecuali acuan jongkong)\n(m) pembuatan alatan penekan\nTidak termasuk: (a) pembuatan barangan bercembung (periuk, cerek, dll.), set makan (mangkuk,\n pinggan leper besar, dll.) atau pinggan mangkuk (pinggan makan, piring, dll.),\nlihat 25994\n(b) pembuatan alat pertukangan tangan kendalian kuasa, lihat 2818\n(c) pembuatan acuan jongkong, lihat 2823\n(d) pembuatan kutleri daripada logam berharga, lihat 3211'),
