('C',	'25',	'259',	'2599(1)',	NULL,	'Pembuatan produk lain yang direka daripada logam\nt.t.t.l.',	NULL,	'(1) Tidak termasuk: (a) pembuatan magnet seramik dan ferit, lihat 23930\n (b) pembuatan tangki dan takungan, lihat 25120\n(c) pembuatan pedang, bayonet, lihat 2593\n(d) pembuatan spring jam atau jam tangan, lihat 26520\n(e) pembuatan wayar dan kabel untuk transmisi bekalan elektrik, lihat 2732\n(f) pembuatan rantai transmisi kuasa, lihat 2814\n(g) pembuatan troli membeli belah, lihat 3099\n(h) pembuatan perabot logam, lihat 31002\n(i) pembuatan barangan sukan, lihat 3230\n(j) pembuatan permainan dan alat mainan, lihat 3240'),
