('E',	'38',	'382',	NULL,	'38220',	'Rawatan dan pelupusan sisa berbahaya(2)',	'90002p, 90003p,\n23300p',	'(2) Termasuk: (a) pelupusan barangan terpakai seperti peti sejuk untuk menyingkirkan sisa\nyang memudaratkan\n(b) rawatan dan pelupusan sisa perantaraan radioaktif dari hospital\n(c) rawatan dan pelupusan sisa toksik yang tercemar\n(d) rawatan dan pelupusan sisa radioaktif nuklear'),
('E',	'38',	'383',	NULL,	NULL,	'Pemulihan semula bahan',	NULL,	NULL),
('E',	'38',	'383',	'3830(1)',	NULL,	'Pemulihan semula bahan',	NULL,	'(1) Termasuk: pemulihan semula bahan dari aliran sisa dengan cara pengasingan bahan daripada\naliran sisa tidak berbahaya (cth. sampah) atau mengasingkan semula bahan-bahan\nyang bercampur seperti kertas, plastik, tin minuman dan logam terpakai mengikut\nkategori yang berbeza, dll.\nTidak termasuk:(a) pengeluaran produk akhir yang baru dari (sendiri atau bukan buatan sendiri)\n bahan mentah logam sekunder, seperti memintal benang daripada alat\ntenunan, membuat pulpa daripada sisa kertas, membuat tayar celup atau\npenghasilan logam daripada sekerap, lihat kelas-kelas yang berkaitan di\nSeksyen C (Pembuatan)\n(b) pemprosesan semula bahan api nuklear, lihat 20119\n(c) mencairkan semula sisa ferus dan sekerap, lihat 24109\n(d) rawatan dan penghapusan sisa yang tidak berbahaya, lihat 38210\n(e) rawatan sisa organik untuk pelupusan, lihat 38210\n(f) pemulihan tenaga daripada proses pembakaran sisa tidak berbahaya, lihat\n38210\n(g) pelupusan barangan terpakai seperti peti sejuk untuk menyingkirkan sisa yang\nmemudaratkan, lihat 38220\n(h) rawatan dan pelupusan sisa perantaraan radioaktif dari hospital dll., lihat\n38220\n(i) rawatan dan pelupusan sisa toksik, bahan tercemar,lihat 38220\n(j) jualan borong bahan-bahan yang boleh dibaikpulih, lihat 4669'),
('E',	'38',	'383',	NULL,	'38301',	'Meremukkan secara mekanikal sisa logam(1)',	'37101, 37109p',	'(1) Termasuk: (a) meremukkan secara mekanikal sisa logam seperti kereta terpakai, mesin\nbasuh, motosikal, kapal, dll. dengan turutan disusun dan diasingkan\n(b) merincih kereta melalui proses mekanikal\n(c) kitar semula tin'),
('E',	'38',	'383',	NULL,	'38302',	'Meleraikan peralatan automobil, komputer,\ntelevisyen dan peralatan lain untuk pemulihan\nbahan(2)',	'37109p',	'(2) Termasuk: “Ship Scaling”,meleraikan\nTidak termasuk:  meleraikan peralatan automobil, komputer, televisyen dan peralatan lain untuk\npemulihan bahan untuk mendapatkan dan menjual semula bahan yang masih boleh\ndigunakan, lihat 46699'),
