('K',	'64',	'641',	NULL,	'64195',	'Institusi Pembangunan Kewangan (dengan fungsi\npengambilan deposit)(3)',	'65196, 65197',	'(3) “Institusi Pembangunan Kewangan” bermakna institusi yang mempunyai aktiviti, sama ada bagi\ntujuan keuntungan atau sebaliknya, dengan atau tanpa apa-apa tabungan kerajaan, dengan tujuan\nmempromosikan pembangunan dalam perindustrian, pertanian, komersil atau sektor ekonomi lain,\ntermasuk peruntukan modal atau kemudahan kredit lain; dan bagi tujuan definisi ini, “pembangunan”\ntermasuk permulaan perindustrian, pertanian, komersil baru atau usahasama ekonomi atau\npengembangan atau penambahbaikan usahasama sedia ada.\n“Institusi Pembangunan Kewangan dengan Fungsi Pengambilan Deposit” bermakna institusi\npembangunan kewangan yang terutamanya terbabit dalam perantaraan kewangan dan isu\ntanggungan tersebut adalah termasuk dalam definisi nasional kepada ‘’wang secara meluas’’.\nTanggungan yang termasuk dalam wang secara meluas adalah terutamanya item deposit seperti\ndeposit boleh pindah, simpanan deposit: terma deposit, dan sijil deposit.\n“Institusi Pembangunan Kewangan Tanpa Fungsi Pengambilan Deposit” ialah institusi\npembangunan kewangan lain yang tidak terkelas seperti di atas.'),
