('T',	'97',	'970',	NULL,	'97000',	'Aktiviti isi rumah sebagai majikan bagi personel domestik(2)',	'95000',	'\n(2) Termasuk: Aktiviti isi rumah sebagai majikan personel domestik (cth. pembantu rumah, tukang\nmasak, pelayan, valet, ketua pembantu rumah, tukang cuci, tukang kebun, penjaga\npintu, pembantu kandang kuda, pemandu, penjaga, pengasuh, penjaga budak, tutor,\nsetiausaha, tukang bersih rumah, individu yang menyediakan perkhidmatan dalam\npantang, pemotong rumput)'),
('T',	'98',	'981',	NULL,	NULL,	'Aktiviti mengeluarkan barangan yang tidak dapat dibezakan oleh isi rumah',	NULL,	NULL),
('T',	'98',	'981',	NULL,	NULL,	'persendirian untuk kegunaan sendiri',	NULL,	NULL),
('T',	'98',	'981',	'9810(1)',	NULL,	'Aktiviti mengeluarkan barangan yang tidak dapat dibezakan oleh isi rumah persendirian untuk kegunaan sendiri',	NULL,	'(1) Termasuk: (a) jika isi rumah terlibat dalam pengeluaran barangan yang dipasarkan, mereka\ndiklasifikasikan kepada industri pengeluaran barangan yang bersesuaian\ndengan MSIC\n(b) jika isi rumah terlibat terutamanya dalam aktiviti pengeluaran barangan sara\nhidup tertentu, mereka diklasifikasikan kepada industri pengeluaran barangan\nyang bersesuaian dengan MSIC'),
('T',	'98',	'981',	NULL,	'98100',	'Aktiviti mengeluarkan barangan yang tidak dapat dibezakan oleh isi rumah',	'k.b.',	'\n(2) Termasuk: (a) memburu dan mengumpul untuk kegunaan sendiri\n(b) memancing dan menternak ayam itik dan ternakan untuk kegunaan sendiri\n(c) berkebun untuk kegunaan sendiri\n(d) menyediakan tempat perlindungan dan pakaian untuk kegunaan sendiri'),
('T',	'98',	'981',	NULL,	NULL,	' persendirian untuk kegunaan sendiri(2)',	NULL,	NULL),
('T',	'98',	'982',	NULL,	NULL,	'Aktiviti menyediakan perkhidmatan yang tidak dapat dibezakan oleh\nisi rumah persendirian untuk kegunaan sendiri',	NULL,	NULL),
('T',	'98',	'982',	'9820(1)',	NULL,	'Aktiviti menyediakan perkhidmatan yang tidak dapat\ndibezakan oleh isi rumah persendirian untuk kegunaan sendiri',	NULL,	'(1) Termasuk: jika isi rumah juga terlibat dalam penghasilan beberapa barangan untuk tujuan\nsaraan, mereka diklasifikasikan kepada aktiviti isi rumah bagi pengeluaran sara\nhidup yang tidak dapat dibezakan oleh isi rumah'),
('T',	'98',	'982',	NULL,	'98200',	'Aktiviti menyediakan perkhidmatan yang tidak dapat\ndibezakan oleh isi rumah persendirian untuk kegunaan\nsendiri(2)',	'k.b.',	'\n(2) Termasuk: (a) perkhidmatan domestik untuk kegunaan sendiri dalam isi rumah:\n• pengurusan makanan\n• membersih dan mengemas tempat kediaman dan persekitaran\n• melakukan hiasan sendiri\n• menyelenggara dan membaiki kerosakan kecil\n• menjaga tekstil dan kasut\n• pengurusan isi rumah\n• menjaga haiwan peliharaan\n• membeli-belah untuk/membeli barangan dan aktiviti yang berkaitan\n• membeli-belah untuk/menyediakan perkhidmatan dan aktiviti berkaitan,\ndll.\n(b) perkhidmatan penjagaan kepada ahli isi rumah:\n• penjagaan anak spt. menjaga fizikal anak, mengajar, melatih, membantu\nanak, menemani anak ke sesuatu tempat, mengawasi anak (penjagaan\npasif)\n• penjagaan orang dewasa spt. menjaga fizikal orang dewasa, menjaga\ndan memberi sokongan emosi kepada orang dewasa, menemani orang\ndewasa ke sesuatu tempat, dll.\n(c) perkhidmatan komuniti dan membantu isi rumah lain:\n• penjagaan anak sebagai membantu isi rumah lain\n• penjagaan orang dewasa sebagai membantu isi rumah lain'),
('U',	'99',	'990',	NULL,	NULL,	'Aktiviti badan dan pertubuhan luar wilayah',	NULL,	NULL),
('U',	'99',	'990',	'9900',	NULL,	'Aktiviti badan dan pertubuhan luar wilayah',	NULL,	NULL),
('U',	'99',	'990',	NULL,	'99000',	'Aktiviti badan dan pertubuhan luar wilayah(1)',	'99000',	'(1) Termasuk : aktiviti organisasi antarabangsa seperti:\n(a) Pertubuhan Bangsa-bangsa Bersatu dan agensi khasnya, Badan Serantau\n(b) Organisasi Negara Amerika\n(c) Majlis Bersama Bantuan Ekonomi\n(d) Komuniti Eropah\n(e) Organisasi Kerjasama dan Pembangunan Ekonomi\n(f) Organisasi Perpaduan Afrika\n(g) Liga Negara-negara Arab, Pertubuhan Negara-negara Asia Tenggara\n(ASEAN)\n(h) Persatuan Negara-negara Pengeluar Getah Asli (ANRPC)\n(i) Persatuan Negara-negara Pengeluar Bijih Timah (ATPC)\n(j) Pusat Pembangunan Asia Pasifik (APDC)\n(k) Majlis Kerjasama Kastam\n(l) Organisasi Pengeluar dan Pengeksport Minyak (OPEC)\n(m) Tabung Kewangan Antarabangsa (IMF)\n(n) Bank Dunia');

